        "source": "// SPDX-License-Identifier: MIT\r\npragma solidity ^0.8.0;\r\n\r\nimport \"@openzeppelin/contracts/token/ERC20/IERC20.sol\";\r\nimport \"@openzeppelin/contracts/token/ERC721/IERC721.sol\";\r\nimport {ReentrancyGuard} from \"./imports/ReentrancyGuard.sol\";\r\nimport \"@openzeppelin/contracts/utils/math/SafeCast.sol\";\r\nimport \"@openzeppelin/contracts/token/ERC1155/ERC1155.sol\";\r\n\r\ncontract EugeneLandTokenClaimContract is ReentrancyGuard {\r\n    using SafeCast for uint256;\r\n\r\n    address public erc20Token;\r\n    uint256 public goldenPioneerNFT;\r\n    uint256 public silverPioneerNFT;\r\n    address public owner;\r\n\r\n    uint256 public contractDeploymentTime;\r\n    uint256 public sevenDays = 7 days;\r\n    uint256 public addtionalDays;\r\n\r\n    address public goldenPioneerNFTAddress;\r\n    address public silverPioneerNFTAddress;\r\n\r\n    event TokensClaimed(\r\n        address indexed recipient,\r\n        uint256 nftId,\r\n        address nftAddress\r\n    );\r\n    event RemainingTokensSentToOwner(address indexed owner);\r\n\r\n    mapping(address => bool) public claimedFirstNFTs;\r\n    mapping(uint256 => bool) public claimedSecondNFTs;\r\n\r\n    modifier onlyOwner() {\r\n        require(msg.sender == owner, \"Not the owner\");\r\n        _;\r\n    }\r\n\r\n    modifier withinDesignatedDays() {\r\n        require(\r\n            (contractDeploymentTime + addtionalDays < block.timestamp \r\n            && block.timestamp <= contractDeploymentTime + sevenDays + addtionalDays),\r\n            \"Claim period Error\"\r\n        );\r\n        _;\r\n    }\r\n\r\n    constructor(address _erc20Token, uint256 _additionalDays) {\r\n        erc20Token = _erc20Token;\r\n        owner = msg.sender;\r\n\r\n        goldenPioneerNFT = 2857 ether;\r\n        silverPioneerNFT = 586 ether;\r\n\r\n        contractDeploymentTime = block.timestamp;\r\n        addtionalDays = _additionalDays * 1 minutes;\r\n\r\n        goldenPioneerNFTAddress = 0xF2E238b666c943bF2F21579AE430d72937bB9986;\r\n        silverPioneerNFTAddress = 0x4243c94B23010099e9744aa601e4287A573e00c0;\r\n    }\r\n\r\n    function validateNFTOwnership(uint256 _nftId) private view returns (bool) {\r\n        return (IERC721(silverPioneerNFTAddress).ownerOf(_nftId) == msg.sender);\r\n    }\r\n\r\n    function validateNFTGoldOwnership() private view returns (bool) {\r\n        // Assuming goldenPioneerNFTAddress is the address of your ERC1155 contract\r\n        // Adjust the interface accordingly if needed\r\n        return IERC1155(goldenPioneerNFTAddress).balanceOf(msg.sender, 0) > 0;\r\n    }\r\n\r\n    function validateNFTAddress(address _nftAddress)\r\n        private\r\n        view\r\n        returns (bool)\r\n    {\r\n        return (_nftAddress == goldenPioneerNFTAddress ||\r\n            _nftAddress == silverPioneerNFTAddress);\r\n    }\r\n\r\n    function tokensRemaining() public view returns (uint256) {\r\n        return ((IERC20(erc20Token).balanceOf(address(this))));\r\n    }\r\n\r\n    function claimTokens(uint256 _nftId, address _nftAddress)\r\n        external\r\n        withinDesignatedDays\r\n        nonReentrant\r\n    {\r\n        require(tokensRemaining() > 0, \"No more tokens to be released\");\r\n\r\n        require(validateNFTAddress(_nftAddress), \"Invalid NFT address\");\r\n\r\n        if (_nftAddress == goldenPioneerNFTAddress) {\r\n            require(validateNFTGoldOwnership(), \"You are not the Owner\");\r\n            require(!claimedFirstNFTs[msg.sender], \"NFT ID already claimed\");\r\n            claimedFirstNFTs[msg.sender] = true;\r\n            IERC20(erc20Token).transfer(msg.sender, goldenPioneerNFT);\r\n        } else {\r\n            require(validateNFTOwnership(_nftId), \"You are not the owner\");\r\n            require(!claimedSecondNFTs[_nftId], \"NFT ID already claimed\");\r\n            claimedSecondNFTs[_nftId] = true;\r\n            IERC20(erc20Token).transfer(msg.sender, silverPioneerNFT);\r\n        }\r\n\r\n        emit TokensClaimed(msg.sender, _nftId, _nftAddress);\r\n    }\r\n\r\n    function sendRemainingTokensToOwner() external onlyOwner nonReentrant {\r\n        uint256 amountLeft = tokensRemaining();\r\n        require(amountLeft > 0, \"No more tokens to be released\");\r\n        IERC20(erc20Token).transfer(owner, amountLeft);\r\n        emit RemainingTokensSentToOwner(owner);\r\n    }\r\n}\r\n",
